// Dashboard.js

import React from 'react';
import { Link, Route, Routes, useNavigate } from 'react-router-dom'; // Import useNavigate
import AddVideo from '../../src/components/video/AddVideo'; // Corrected typo in file name
import AddCategory from '../../src/components/video/AddCategory'; // Corrected typo in file name
import ShowVideos from '../../src/components/video/ShowVideos';
import '../css/navbar.css';

const Dashboard = () => {
  const navigate = useNavigate(); // Get navigate function from React Router

  const handleLogout = () => {
    // Handle logout logic here, such as clearing authentication token, etc.
    // Then navigate to the login page
    navigate('/login');
  };

  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/dashboard/add-video">Add Video</Link>
          </li>
          <li>
            <Link to="/dashboard/add-category">Add Category</Link>
          </li>
          <li>
            <Link to="/dashboard/show-videos">Videos List</Link>
          </li>
          <li>
            <button onClick={handleLogout}>Logout</button> {/* Logout button */}
          </li>
        </ul>
      </nav>

      <Routes>
        {/* Ensure all children of Routes are Route components */}
        <Route path="/dashboard/add-video" element={<AddVideo />} />
        <Route path="/dashboard/add-category" element={<AddCategory />} />
        <Route path="/dashboard/show-videos" element={<ShowVideos />} />
      </Routes>
    </div>
  );
};

export default Dashboard;
